import styled from 'styled-components/native';


export default function AddMealHeader(){

    return(
        <Grid st>
            <Row size={1} style={headerStyle.rowStyle}>
                <ButtonStyle title="Mahlzeit erstellen"/>
            </Row>
        </Grid>
    )
}

const headerStyle = StyleSheet.create({
    rowStyle: {
        display: 'flex',
        justifyItems: 'flex-end',
        backgroundColor: '#803d3d'
    },
    addButton: {
        justifyContent: 'right',
    }
})


const ButtonStyle = styled.Button`
    background-color: #803838;
    height: 30px;
    color: black;
`
